import Hero from "./Hero";
import Discover from "./Discover";
import Create from "./Create";
import Learn from "./Learn";
import Contact from "./Contact";

export default function Main() {
  return (
    <main className="main">
      <Hero />
      <Discover />
      <Create />
      <Learn />
      <Contact />
    </main>
  );
}
